d = dict()
s = 11
p = ''
q = ''
# p = 'tabriz'
# q = 'torino'
l = len(p)

def solve(mid):
	for i in range(mid,l+1):
		for j in range(mid,l+1):
			tmp = d[i].get(j,0)-d[i-mid].get((j-mid),0)
			if tmp<=s:
				return True
	return False

# for i in range(l+1):
# 	d[i] = dict()
# 	d[0][i] = 0
# 	d[i][0] = 0
# # print(d)
d[l]  = dict()
d[0] = dict()
for i in range(l):
	d[i+1] = dict()
	# if i not in d.keys():
	# 	print(i,d.keys())
	# 	d[i] = dict()
	for j in range(l):
		if p[i] == q[j] :
			# print(i,j,d)
			d[i+1][j+1] = d[i].get(j,0)
		else:
			d[i+1][j+1] = d[i].get(j,0)+1
	# print(d)

low,high = 0,l
# print(d)
while(low<high):
	mid = (low+high+1)//2
	if(solve(mid)): low = mid
	else: high = mid-1

